INSERT INTO `skillsheet_implants` VALUES ('2082', '300', 'Genolution Core Augmentation CA-1', '<font color=\"yellow\"><b>Traits</b></font><br>Slot 1<br>Primary Effect: +3 bonus to Perception<br>Secondary Effect: +1.5% bonus to powergrid and capacitor amount<br>Implant Set Effect: 50% bonus to the strength of all Genolution implant secondary effects<br><br><font color=\"yellow\"><b>Development</b></font><br>The modestly titled  Core Augmentation  implant set was developed by Genolution with the assistance of implantation specialists and other leaders in the field of neural augmentation, some of whom have long been rumored to be SoCT alumni.<br><br>The CA-1 is a rarity in the often hyper-specialized industry of neural augmentations. It provides a dual function; tapping into both the occipital lobe for a perception boost, and also the neocortex, for improving the brain\'s handling of a ship\'s energy and capacitor needs. Like the infamous pirate implant sets found on capsuleer markets, each implant is also designed to work at higher levels when integrated into a neural implant network.<br><br>Though many in the augmentation industry initially questioned the agenda behind Genolution\'s entry into the implantation field, fears eventually subsided as the implant was shown to be one of the safest on record. Genolution went one step further to assuage fears however and vowed never to release the implant to open markets, providing only a single-run issue to capsuleers as a demonstration of the technology.', '3');
INSERT INTO `skillsheet_implants` VALUES ('2589', '300', 'Genolution Core Augmentation CA-2', '<font color=\"yellow\"><b>Traits</b></font><br>Slot 4<br>Primary Effect: +3 bonus to Intelligence<br>Secondary Effect: +1.5% bonus to CPU and capacitor recharge<br>Implant Set Effect: 40% bonus to the strength of all Genolution implant secondary effects<br><br><font color=\"yellow\"><b>Development</b></font><br>This is the second half of the Core Augmentation implant set, delivered by Genolution as a follow-up to the CA-1 just months after their first demonstration of new augmentation techniques shook up the often-stagnant industry.<br><br>The CA-2 picks up where its predecessor left off, providing a dual boost via frontal lobe enhancements and a neocortical modification that complements the CA-1\'s focus on a captain\'s ship-fitting concerns. The end result is an increase to intelligence, coupled with improved CPU output and capacitor recharge rate. Additionally, when combined the CA-1 and the CA-2 supplement each other, providing vast increases in their overall net effect.<br><br>Concurrent with the release of the CA-2, Genolution offered up the implant\'s schematics for public inspection. They claimed the move was designed not only to allay any lingering fears about the technology - now widespread amongst the capsuleer class - but also to provide a foundation for future advances in the field.', '3');
