INSERT INTO `skillsheet_implants` VALUES ('33393', '300', 'Genolution Core Augmentation CA-3', '<font color=\"yellow\"><b>Traits</b></font><br>Slot 3<br>Primary Effect: +3 bonus to Willpower<br>Secondary Effect: +1.5% bonus to ship velocity and shield capacity<br>Implant Set Effect: 30% bonus to the strength of all Genolution implant secondary effects<br><br><font color=\"yellow\"><b>Development</b></font><br>\r\r\nSince the introduction of the groundbreaking \"Core Augmentation\" series in YC 113, all eyes have been on Genolution\'s advanced R&D department in anticipation of their next release. Few if any were disappointed with the announcement of the CA-3.<br><br>Rumors that Genolution had managed to reverse-engineer Angel Cartel implant technology continued to spread as the CA-3 successfully allows a capsuleer increased ship velocity, complemented by extra shield capacity and a parietal lobe enhancement for stronger Willpower. Like the CA-1 and CA-2 before them, these new additions to the \"Core Augmentation\" line contain advanced interoperability functions that allows their sum to be greater than their parts.<br><br>Genolution\'s press releases indicated that this new batch of implants would be available to capsuleers in limited numbers, but after the experience of the CA-1 and CA-2 nobody believes them.', '3');
INSERT INTO `skillsheet_implants` VALUES ('33394', '300', 'Genolution Core Augmentation CA-4', '<font color=\"yellow\"><b>Traits</b></font><br>Slot 2<br>Primary Effect: +3 bonus to Memory<br>Secondary Effect: +1.5% bonus to ship agility and armor hit points<br>Implant Set Effect: 20% bonus to the strength of all Genolution implant secondary effects<br><br><font color=\"yellow\"><b>Development</b></font><br>\r\r\nAlongside the introduction of the CA-3 implant, Genolution further expanded its \"Core Augmentation\" line with the new CA-4. Taking full advantage of Genolution\'s formidable research and development team, the CA-4 continues to squeeze even more powerful features into the most significant implant collection to be released in years.<br><br>The combination of a temporal lobe implant for extra memory augmentation and a new series of armor and agility enhancements makes the CA-4 stand out from the crowd. However, the most impressive feature of the implant is that Genolution has managed to squeeze even more benefits out of their implant integration technology to ensure that each part of the \"Core Augmentation\" line enhances the benefits of each of its peers.<br><br>After the release of these groundbreaking implants there is only one question left on everyone\'s mind: How much further can Genolution safely push the limits of their technology?', '3');
